//
//	Deze interuptroutine wordt opgeroepen bij elke timer comp-match
//
void HAL_TIM_PeriodElapsedCallback(TIM_HandleTypeDef *htim)
{
	HAL_GPIO_TogglePin(GPIOA,Esp_Rx_Pin);
	static uint32_t teller = 0;

	// We willen enkel de compare van timer3
	if(htim->Instance ==  TIM3)
	{
		__HAL_TIM_SET_COMPARE(&htim4,TIM_CHANNEL_3,samples[teller]);
		teller++;
	}

	if(teller >= 88200)
	{
		teller = 0;
	}
}

